void move_button_outline(int b1, int b2, int b3){
	
	int button_size = 5;
	if(!move_button_outline_bar){
		if(b1 == (int)0xe0 && b2 == (int)0xf0){
			if(b3 == (int)0x74 || b3 == (int)0x6b){
				move_button_outline_bar = true;
			}
		}
		return;
	}
	else if(move_button_outline_bar && b2 == (int)0xe0){ 
		// remove_old_mouse();

		if(b3 == 0x72){ // DOWN arrow
			typing = true;
			byte1 = byte2 = byte3 = 0;
			delete_square(220, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 220 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
			delete_square(230, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 230 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
			delete_square(240, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 240 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
		}
		if(b3 == (int)0x74){// RIGHT arrow
			if(!(button_posit >= 2)){
				button_posit++;
			}
			move_button_outline_bar = false;
		}
		else if(b3 == (int)0x6b){ // LEFT arrow
			if(!(button_posit <= 0)){
				button_posit--;
			}
			move_button_outline_bar = false;
		}
		if(b3 == (int)0x74 || b3 == (int)0x6b){
			
			switch (button_posit){
				case 0: // On BLUE (minimize)
					delete_square(230, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 230 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
					delete_square(240, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 240 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
					draw_square(220, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 220 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1));
					break;
				case 1: // On Green (save)
					delete_square(220, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 220 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
					delete_square(240, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 240 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
					draw_square(230, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 230 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1));
					break;
				default:
					//On red (close)
					delete_square(230, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 230 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
					delete_square(220, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 220 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
					draw_square(240, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 240 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1));
					break;
			}
		}
		
	}
	if(b3 == (int)0x5a && b2 != (int)0xf0 && draw_screen && in_screen_editor){
		if(button_posit == 2){ // RED button
			exit_file();
		}
		else if(button_posit == 1){	// GREEN button
			save_file();
			draw_screen = false;
			
		}
		else if(button_posit == 0){	// BLUE button
			save_as_execution();
		}
	}
	
}

