short int save_pixel(int x, int y){
	volatile short int *one_pixel_address;
	one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
	return *one_pixel_address;
}

void plot_pixel(int x, int y, short int line_color){
	volatile short int *one_pixel_address;
	one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
	*one_pixel_address = line_color;
}

void move_outline(int b1, int b2, int b3){
	if(!move_outline_bar){
		if(b1 == (int)0xe0 && b2 == (int)0xf0){
			if(b3 == (int)0x72 || b3 == (int)0x74 || b3 == (int)0x75 || b3 == (int)0x6b){
				move_outline_bar = true;
			}
		}
		return;
	}
	else if(move_outline_bar && b2 == (int)0xe0){ 
		// remove_old_mouse();
		clear_char_buffer();
		delete_square_home_screen(xpos, ypos-1, xpos_2, ypos_2, FILE_ICON_SIDE_LENGTH);
		bool found = false;

		if(b3 == (int)0x72){	// DOWN arrow
			for(int y = ypos+ICON_SPACING; y <= (ICON_SPACING*SCREEN_MAX_ROWS); y += ICON_SPACING){
				if(Icons[(xpos-ICON_SPACING)/ICON_SPACING][(y-ICON_SPACING)/ICON_SPACING].file_presence == 1){
					found = true;
					ypos = y;
					ypos_2 = y + FILE_ICON_SIDE_LENGTH;
					break;
				}
			}
			if(!found){
				//clear_char_buffer();
				in_taskbar = true;
				draw_square(xpos_task, SCREEN_HEIGHT - TASKBAR_HEIGHT + 1, xpos_task + 13, SCREEN_HEIGHT - 2);
				move_outline_bar = true;
				return;
			}
		}
		else if( b3 == (int)0x75){	// UP arrow
			int y_start;
			for(int x = xpos; x >= ICON_SPACING; x-=ICON_SPACING){
				
				if(found){
					break;
				}
				y_start = ICON_SPACING*SCREEN_MAX_ROWS;
				if(x == xpos){
					y_start = ypos-ICON_SPACING;
				}
				
				for(int y = y_start; y >= ICON_SPACING; y -= ICON_SPACING){
					if(Icons[(x-ICON_SPACING)/ICON_SPACING][(y-ICON_SPACING)/ICON_SPACING].file_presence == 1){
						found = true;
						ypos = y;
						ypos_2 = y + FILE_ICON_SIDE_LENGTH;
						xpos = x;
						xpos_2 = x + FILE_ICON_SIDE_LENGTH;
						break;
					}
				}
			}
		}
		else if(b3 == (int)0x74){ // RIGHT arrow
			int x_start;
			for(int y = ypos; y <= (ICON_SPACING*SCREEN_MAX_ROWS); y += ICON_SPACING){

				if(found){
					break;
				}
				x_start = ICON_SPACING;
				if(y == ypos){
					x_start = xpos + ICON_SPACING;
				}

				for(int x = x_start; x <= (ICON_SPACING*SCREEN_MAX_COLUMNS); x += ICON_SPACING){
					if(Icons[(x-ICON_SPACING)/ICON_SPACING][(y-ICON_SPACING)/ICON_SPACING].file_presence == 1){
						found = true;
						ypos = y;
						ypos_2 = y + FILE_ICON_SIDE_LENGTH;
						xpos = x;
						xpos_2 = x + FILE_ICON_SIDE_LENGTH;
						break;
					}
				}
			}
			
		}
		else if(b3 == (int)0x6b){ // LEFT arrow
			int x_start;
			for(int y = ypos; y >= ICON_SPACING; y -= ICON_SPACING){

				if(found){
					break;
				}
				x_start = ICON_SPACING*SCREEN_MAX_ROWS;
				if(y == ypos){
					x_start = xpos - ICON_SPACING;
				}

				for(int x = x_start; x >= ICON_SPACING; x -= ICON_SPACING){
					if(Icons[(x-ICON_SPACING)/ICON_SPACING][(y-ICON_SPACING)/ICON_SPACING].file_presence == 1){
						found = true;
						ypos = y;
						ypos_2 = y + FILE_ICON_SIDE_LENGTH;
						xpos = x;
						xpos_2 = x + FILE_ICON_SIDE_LENGTH;
						break;
					}
				}
			}
			
		}

		draw_square(xpos, ypos-1, xpos_2, ypos_2);
		move_outline_bar = false;
		display_file_name();

	}
}

void move_outline_in_taskbar(int b1, int b2, int b3){
	if(!move_outline_bar){
		if(b1 == (int)0xe0 && b2 == (int)0xf0){
			if( b3 == (int)0x74 || b3 == (int)0x75 || b3 == (int)0x6b){
				move_outline_bar = true;
			}
		}
		return;
	}
	else if(move_outline_bar && b2 == (int)0xe0){ 
		// remove_old_mouse();
		
		if( b3 == (int)0x75){	// UP arrow
			clear_char_buffer();
			in_taskbar = false;
			draw_square(xpos, ypos-1, xpos_2, ypos_2);
			move_outline_bar = false;
			delete_square(xpos_task, SCREEN_HEIGHT - TASKBAR_HEIGHT + 1, xpos_task + 13, SCREEN_HEIGHT - 2, 0b1100011000011000);
			xpos_task = 40;
			display_file_name();
			
		}
		else if(b3 == (int)0x74){// RIGHT arrow

			if(Icons[(xpos_task- TASKBAR_LEFT_MARGIN + ICON_SPACING)/ICON_SPACING][SCREEN_MAX_ROWS].file_presence == 1){
				delete_square(xpos_task, SCREEN_HEIGHT - TASKBAR_HEIGHT + 1, xpos_task + 13, SCREEN_HEIGHT - 2, 0b1100011000011000);
				xpos_task += ICON_SPACING;
				draw_square(xpos_task, SCREEN_HEIGHT - TASKBAR_HEIGHT + 1, xpos_task + 13, SCREEN_HEIGHT - 2);
			}
			move_outline_bar = false;
		}
		else if(b3 == (int)0x6b){// LEFT arrow
			if(Icons[(xpos_task-TASKBAR_LEFT_MARGIN-ICON_SPACING)/ICON_SPACING][SCREEN_MAX_ROWS].file_presence == 1){
				delete_square(xpos_task, SCREEN_HEIGHT - TASKBAR_HEIGHT + 1, xpos_task + 13, SCREEN_HEIGHT - 2, 0b1100011000011000);
				xpos_task -= ICON_SPACING;
				draw_square(xpos_task, SCREEN_HEIGHT - TASKBAR_HEIGHT + 1, xpos_task + 13, SCREEN_HEIGHT - 2);
			}
			move_outline_bar = false;
		}
	}

	
}

