void wait_for_vsync()
{
	volatile int *pixel_ctrl_ptr = (int *)0xff203020; // base address
	int status;
	*(pixel_ctrl_ptr) = 1; // swap buffers
	// - write 1 into front buffer address register
	status = *(pixel_ctrl_ptr + 3); // read the status register
	while ((status & 0x01) != 0)
	{ // polling loop waiting for S bit to go to 0
		status = *(pixel_ctrl_ptr + 3);
	}
}

void interrupt_handler(void)
{
	volatile int * PS2_mouse_ptr = (int *)0xff200108;
	int ipending;
	NIOS2_READ_IPENDING(ipending);
	if (ipending & 0x2)
	{
		pushbutton_ISR();
	}
	else if (ipending & 0x800000)	// IRQ 23	
	{
		int PS2_data, RVALID;
		
		PS2_data = *(PS2_mouse_ptr); // read the Data register in the PS/2 port
		RVALID = PS2_data & 0x8000; // extract the RVALID field
		//RAVAIL = PS2_data & 0xffff0000; // extract RAVAIL field
		
		if (RVALID != 0) {
			/* shift the next data byte into the display */
			interrupt_mouse_data++;
			inter_byte1 = inter_byte2;
			inter_byte2 = inter_byte3;
			inter_byte3 = PS2_data & 0xFF;
			HEX_PS2(inter_byte1, inter_byte2, inter_byte3);
		}
		if(inter_byte2 == (int)0xaa && inter_byte3 == (int)0x00){
			
			*(PS2_mouse_ptr) = 0xF4;
			// mouse_data = -1;
		}
		if(interrupt_mouse_data == 3){
			interrupt_mouse_data = 0;
			HEX_PS2(inter_byte1, inter_byte2, inter_byte3);
			
			draw_cursor(inter_byte1, inter_byte2, inter_byte3);

			// if left mouse button is clicked
			if (inter_byte1 & 0x1){
				// mouse_x
				// mouse_y
				//printf("clicked\n");


				if(in_save_as){	// In save as screen
					if(mouse_y > 125 && mouse_y < 133){
						if(mouse_x > 102 && mouse_x < 120){ // SAVE Button
							int col__, row__;
							if(type_of_file == 1){
								col__ = (initial_x-ICON_SPACING)/ICON_SPACING;
								row__ = (initial_y-ICON_SPACING)/ICON_SPACING;
							}else{
								col__ = (xpos-ICON_SPACING)/ICON_SPACING;
								row__ = (ypos-ICON_SPACING)/ICON_SPACING;
							}
							Icons[col__][row__].file_name = Icons[col__][row__].prev_file_name;
							Icons[col__][row__].file_name_size = Icons[col__][row__].prev_file_name_size;
							Icons[col__][row__].name_set = true;
							save_file();
							typing = false;
							draw_screen = false;
							in_save_as = false;
						}
						else if(mouse_x > 142 && mouse_x < 168){	// CANCEL button
							remove_save_as_screen();
							in_save_as = false;
							typing = false;
							typing_file_name = false;
						}
					}
				}
				else if(!in_save_as && in_screen_editor){	// In text editor but not in 'save as' screen
					int button_size = 5;
					if(mouse_y > (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER) && mouse_y <= (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size))
						if(mouse_x > 220 && mouse_x < 220 + button_size){	// BLUE button
							delete_square(230, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 230 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
							delete_square(240, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 240 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1), 0b111101111001111);
							draw_square(220, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER), 220 + button_size, (TEXT_EDITOR_TOP_LEFT_Y + TEXT_EDITOR_SIDE_BORDER+ button_size + 1));	
							save_as_execution();
						}
						else if(mouse_x > 230 && mouse_x < 230 + button_size){	// GREEN button
							save_file();
							typing = false;
						}
						else if(mouse_x > 240 && mouse_x < 240 + button_size){	// RED button
							exit_file();
						}
				}
				else{	// In main screen

				}
			}
		}
	}
	// else, ignore the interrupt
}

void pushbutton_ISR(void){
	volatile int *KEY_ptr = (int *)0xff200050;
	volatile int *LED_ptr = (int *)0xff200000;
	int press;
	press = *(KEY_ptr + 3); // read the pushbutton interrupt register
	*(KEY_ptr + 3) = press; // Clear the interrupt
	if(!in_screen_editor){
		
		*(LED_ptr) = press;
		check = false;
		if(press == 0x1){
			draw_icon(file_icon);
		}
		else if(press == 0x2){
			delete_icon(file_icon, 25, 25);
			delete_square_home_screen(xpos, ypos-1, xpos_2,  ypos_2, FILE_ICON_SIDE_LENGTH);
			xpos = ICON_SPACING;
			ypos = ICON_SPACING;
			xpos_2 = ICON_SPACING + FILE_ICON_SIDE_LENGTH;
			ypos_2 = ICON_SPACING + FILE_ICON_SIDE_LENGTH;
			draw_square(xpos, ypos-1, xpos_2,  ypos_2);
		}
	}
	return;
}

void clear_char_buffer(){
	for (int x = 0; x < 80; x++)
	{
		for (int y = 0; y < 60; y++)
		{
			volatile uint8_t *one_char_address;
			one_char_address = char_buffer_start + (y << 7) + x;
			*one_char_address = 0;
		}
	}
}

bool plot_char(int x, int y, uint8_t letter){
	if(letter == 0 || letter == 19 || letter == 27 || (letter == 32 && in_save_as)){
		return false;
	}
	if(letter == 13 && !in_save_as){
		test_y += 2;
		test_x = 6;
		return true;
	}
	else if(letter == 13 && in_save_as){
		return false;
	}

	volatile uint8_t *one_char_address;
	one_char_address = char_buffer_start + (y << 7) + x;

	// Backspace
	if (letter == 8){
		*one_char_address = 0;
	} else {
		*one_char_address = letter;
	}

	return true;
}

void the_exception(void){
	asm("subi sp, sp, 128");
	asm("stw et, 96(sp)");
	asm("rdctl et, ctl4");
	asm("beq et, r0, SKIP_EA_DEC"); // Interrupt is not external
	asm("subi ea, ea, 4");
	asm("SKIP_EA_DEC:");
	asm("stw r1, 4(sp)"); // Save all registers
	asm("stw r2, 8(sp)");
	asm("stw r3, 12(sp)");
	asm("stw r4, 16(sp)");
	asm("stw r5, 20(sp)");
	asm("stw r6, 24(sp)");
	asm("stw r7, 28(sp)");
	asm("stw r8, 32(sp)");
	asm("stw r9, 36(sp)");
	asm("stw r10, 40(sp)");
	asm("stw r11, 44(sp)");
	asm("stw r12, 48(sp)");
	asm("stw r13, 52(sp)");
	asm("stw r14, 56(sp)");
	asm("stw r15, 60(sp)");
	asm("stw r16, 64(sp)");
	asm("stw r17, 68(sp)");
	asm("stw r18, 72(sp)");
	asm("stw r19, 76(sp)");
	asm("stw r20, 80(sp)");
	asm("stw r21, 84(sp)");
	asm("stw r22, 88(sp)");
	asm("stw r23, 92(sp)");
	asm("stw r25, 100(sp)"); // r25 = bt (skip r24 = et, because it is saved
	// above)
	asm("stw r26, 104(sp)"); // r26 = gp
	// skip r27 because it is sp, and there is no point in saving this
	asm("stw r28, 112(sp)"); // r28 = fp
	asm("stw r29, 116(sp)"); // r29 = ea
	asm("stw r30, 120(sp)"); // r30 = ba
	asm("stw r31, 124(sp)"); // r31 = ra
	asm("addi fp, sp, 128");
	asm("call interrupt_handler"); // Call the C language interrupt handler
	asm("ldw r1, 4(sp)");		   // Restore all registers
	asm("ldw r2, 8(sp)");
	asm("ldw r3, 12(sp)");
	asm("ldw r4, 16(sp)");
	asm("ldw r5, 20(sp)");
	asm("ldw r6, 24(sp)");
	asm("ldw r7, 28(sp)");
	asm("ldw r8, 32(sp)");
	asm("ldw r9, 36(sp)");
	asm("ldw r10, 40(sp)");
	asm("ldw r11, 44(sp)");
	asm("ldw r12, 48(sp)");
	asm("ldw r13, 52(sp)");
	asm("ldw r14, 56(sp)");
	asm("ldw r15, 60(sp)");
	asm("ldw r16, 64(sp)");
	asm("ldw r17, 68(sp)");
	asm("ldw r18, 72(sp)");
	asm("ldw r19, 76(sp)");
	asm("ldw r20, 80(sp)");
	asm("ldw r21, 84(sp)");
	asm("ldw r22, 88(sp)");
	asm("ldw r23, 92(sp)");
	asm("ldw r24, 96(sp)");
	asm("ldw r25, 100(sp)"); // r25 = bt
	asm("ldw r26, 104(sp)"); // r26 = gp
	// skip r27 because it is sp, and we did not save this on the stack
	asm("ldw r28, 112(sp)"); // r28 = fp
	asm("ldw r29, 116(sp)"); // r29 = ea
	asm("ldw r30, 120(sp)"); // r30 = ba
	asm("ldw r31, 124(sp)"); // r31 = ra
	asm("addi sp, sp, 128");
	asm("eret");
}

void HEX_PS2(int b1, int b2, int b3) {
	volatile int * HEX3_HEX0_ptr = (int *)0xff200020;
	volatile int * HEX5_HEX4_ptr = (int *)0xff200030;
	/* SEVEN_SEGMENT_DECODE_TABLE gives the on/off settings for all segments in
	 * a single 7-seg display in the DE1-SoC Computer, for the hex digits 0 - F
	 */
	unsigned char seven_seg_decode_table[] = {
		0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07,
		0x7F, 0x67, 0x77, 0x7C, 0x39, 0x5E, 0x79, 0x71};
	unsigned char hex_segs[] = {0, 0, 0, 0, 0, 0, 0, 0};
	unsigned int shift_buffer, nibble;
	unsigned char code;
	int i;
	shift_buffer = (b1 << 16) | (b2 << 8) | b3;
	for (i = 0; i < 6; ++i)
	{
		nibble = shift_buffer & 0x0000000F; // character is in rightmost nibble
		code = seven_seg_decode_table[nibble];
		hex_segs[i] = code;
		shift_buffer = shift_buffer >> 4;
	}
	/* drive the hex displays */
	*(HEX3_HEX0_ptr) = *(int *)(hex_segs);
	*(HEX5_HEX4_ptr) = *(int *)(hex_segs + 4);
}

