			case 0x5d:	ready_for_next_character = true; break;
			case 0x4c:	ready_for_next_character = true; break;
			case 0x52:	ready_for_next_character = true; break;
			case 0x41:	ready_for_next_character = true; break;
			case 0x49:	ready_for_next_character = true; break;
